import { NavLink } from 'react-router-dom'

function HelpLayout() {
  return (
    <div>
        <NavLink to='FAQ' >View FAQ</NavLink>
        <NavLink to='FAQ' >View FAQ</NavLink>
    </div>
  )
}

export default HelpLayout
